import './botao.css'

interface BotaoProps{
    children?: React.ReactNode | string
    type?:'button' | 'submit' | 'reset' | undefined
    onClick?:()=>void
}

function Botao(props:BotaoProps){
    return(
        <div  className="Botao">
        <button
         onClick={onclick}
         type={type}
         >

            {props.children}
        </button>
        </div>
    )
}
export default Botao;
